.cucumber-react .cucumber-status--passed {

}

}

}

  opacity: 0;
  transition: all 0.35s ease-in-out;

  left: -20px;
  display: flex;
  align-items: center;
}
.cucumber-react .cucumber-anchor__icon {
  margin-right: 0.5em;
}
.cucumber-react .cucumber-anchor:hover a {

  width: max-content;
  transition: all 0.35s ease-in-out;
}

  height: 100%;
  margin-top: 0px;
}

.cucumber-report-header {
  width: 100%;
  display: grid;
  grid-template-columns: 1fr;
  border: 1px solid rgba(0, 0, 0, 0.1);
  font: 11px "Open Sans", sans-serif;
  margin-bottom: 1em;
}
.cucumber-report-header > * {

}
.cucumber-report-header .cucumber-status-filter {

}
.cucumber-report-header .cucumber-status-filter table {
  width: 100%;
}
.cucumber-report-header .cucumber-execution-data {
  border-bottom: 1px solid rgba(0, 0, 0, 0.1);
}
.cucumber-report-header .cucumber-search-bar {
  border-right: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search {
  width: 100%;
  display: grid;
  grid-template-columns: 9fr 1fr;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search input {
  padding: 0.4em;
  border-radius: 0;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-search button {
  height: 2.2em;
  padding-left: 0.6em;
  padding-right: 0.6em;
}
.cucumber-report-header .cucumber-search-bar p.help {

.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul {
  display: inline;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li {
  list-style-type: none;
  display: inline-block;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li input {
  display: inline-block;
  width: auto;
  height: 0.6em;
}
.cucumber-report-header .cucumber-search-bar form.cucumber-search-bar-filter ul li label {
  padding-right: 1em;
}

@media only screen and (min-width: 600px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: 1/-1;
  }
}
@media only screen and (min-width: 992px) {
  .cucumber-report-header {
    grid-template-columns: 1fr 1fr 2fr;
  }
  .cucumber-report-header .cucumber-status-filter {
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-execution-data {
    border-right: 1px solid rgba(0, 0, 0, 0.1);
    border-bottom: 0;
  }
  .cucumber-report-header .cucumber-search-bar {
    grid-column: auto;
  }
}
.accordion {
    border: 1px solid rgba(0, 0, 0, 0.1);
    border-radius: 2px;
}

.accordion__item + .accordion__item {
    border-top: 1px solid rgba(0, 0, 0, 0.1);
}

.accordion__button {
    background-color: #f4f4f4;
    color: #444;
    cursor: pointer;
    padding: 10px;
    width: 100%;
    text-align: left;
    border: none;
}

.accordion__button:hover {
    background-color: #ddd;
}

.accordion__button:before {
    display: inline-block;
    content: '';
    height: 10px;
    width: 10px;
    margin-right: 12px;
    border-bottom: 2px solid currentColor;
    border-right: 2px solid currentColor;
    transform: rotate(-45deg);
}

.accordion__button[aria-expanded='true']::before,
.accordion__button[aria-selected='true']::before {
    transform: rotate(45deg);
}

.accordion__panel {
    padding: 20px;
    animation: fadein 0.35s ease-in;
}

ource":{"uri":"file:///C:/Users/rudra.singh/eclipse-workspace/BooksWagon/src/test/resources/features/Register.feature","data":"#Feature: User Registration Functionality\r\n#\r\n  #Scenario: User can signup with valid inputs\r\n    #Given User is on the BooksWagon registration page\r\n    #When User enters valid name, email, mobile number, and password\r\n    #And User selects the captcha\r\n    #And User enters correct OTP\r\n    #And User clicks on Signup button\r\n    #Then User should be registered successfully\r\n#\r\n  #Scenario: User tries to signup with invalid name input\r\n    #Given User is on the BooksWagon registration page\r\n    #When User enters an invalid name\r\n    #And User clicks on Signup button\r\n    #Then User should see an error message \"invalid_name_msg\"\r\n#\r\n  #Scenario: User tries to signup with invalid mobile number\r\n    #Given User is on the BooksWagon registration page\r\n    #When User enters an invalid mobile number\r\n    #And User clicks on Signup button\r\n    #Then User should see an error message \"invalid_mobile_msg\"\r\n#\r\n  #Scenario: User tries to signup without selecting captcha\r\n    #Given User is on the BooksWagon registration page\r\n    #When User enters valid details but skips captcha\r\n    #And User clicks on Signup button\r\n    #Then User should see an error message \"captcha_required_msg\"\r\n#\r\n  #Scenario: User tries to signup with invalid OTP\r\n    #Given User is on the BooksWagon registration page\r\n    #When User enters invalid OTP\r\n    #And User clicks on Signup button\r\n    #Then User should see an error message \"invalid_otp_msg\"\r\n#\r\n  #Scenario: User tries to signup with invalid password\r\n    #Given User is on the BooksWagon registration page\r\n    #When User enters an invalid password\r\n    #And User clicks on Signup button\r\n    #Then User should see an error message \"invalid_password_msg\"\r\n#\r\n  #Scenario: User tries to signup with different confirm password\r\n    #Given User is on the BooksWagon registration page\r\n    #When User enters password \"valid_password\"\r\n    #And User enters confirm password \"mismatch_password\"\r\n    #And User clicks on Signup button\r\n    #Then User should see an error message \"password_mismatch_msg\"\r\n#\r\n  #Scenario: User tries to signup with null inputs\r\n    #Given User is on the BooksWagon registration page\r\n    #When User leaves all required fields empty\r\n    #And User clicks on Signup button\r\n    #Then User should see an error message \"empty_fields_msg\"\r\n#\r\n  #Scenario: User tries to signup with mobile number exceeding 10 digits\r\n    #Given User is on the BooksWagon registration page\r\n    #When User enters a mobile number with more than 10 digits\r\n    #And User clicks on Signup button\r\n    #Then User should see an error message \"invalid_mobile_length_msg\"\r\n    \r\n    \r\n    \r\n    \r\n    \r\n    \r\n @Signup\r\nFeature: User Registration Functionality\r\n\r\n  @ValidSignup\r\n  Scenario: User can signup with valid inputs\r\n    Given User is on the BooksWagon registration page\r\n    When User enters valid name \"valid_name\", mobile number \"valid_mobile\", and signup password \"valid_password\"\r\n    And User selects the captcha manually\r\n    And User clicks on Continue button\r\n    And User enters OTP \"valid_otp\"\r\n    And User enters signup password \"valid_password\"\r\n    And User enters confirm password \"valid_password\"\r\n    And User clicks on Signup button\r\n    Then User should be registered successfully\r\n\r\n  @InvalidName\r\n  Scenario: User tries to signup with invalid name input\r\n    Given User is on the BooksWagon registration page\r\n    When User enters an invalid name \"invalid_name\", mobile number \"valid_mobile\", and signup password \"valid_password\"\r\n    And User selects the captcha manually\r\n    And User clicks on Continue button\r\n    Then User should see an error message \"invalid_name_msg\"\r\n\r\n  @InvalidMobile\r\n  Scenario: User tries to signup with invalid mobile number\r\n    Given User is on the BooksWagon registration page\r\n    When User enters valid name \"valid_name\", invalid mobile number \"invalid_mobile\", and signup password \"valid_password\"\r\n    And User selects the captcha manually\r\n    And User clicks on Continue button\r\n    Then User should see an error message \"invalid_mobile_msg\"\r\n\r\n  @CaptchaRequired\r\n  Scenario: User tries to signup without selecting captcha\r\n    Given User is on the BooksWagon registration page\r\n    When User enters valid name \"valid_name\", mobile number \"valid_mobile\", and signup password \"valid_password\"\r\n    And User skips captcha selection\r\n    And User clicks on Continue button\r\n    Then User should see an error message \"captcha_required_msg\"\r\n\r\n  @InvalidOTP\r\n  Scenario: User tries to signup with invalid OTP\r\n    Given User is on the BooksWagon registration page\r\n    When User enters valid name \"valid_name\", mobile number \"valid_mobile\", and signup password \"valid_password\"\r\n    And User selects the captcha manually\r\n    And User clicks on Continue button\r\n    And User enters OTP \"invalid_otp\"\r\n    And User enters signup password \"valid_password\"\r\n    And User enters confirm password \"valid_password\"\r\n    And User clicks on Signup button\r\n    Then User should see an error message \"invalid_otp_msg\"\r\n\r\n  @InvalidPassword\r\n  Scenario: User tries to signup with invalid signup password\r\n    Given User is on the BooksWagon registration page\r\n    When User enters valid name \"valid_name\", mobile number \"valid_mobile\", and signup password \"invalid_password\"\r\n    And User selects the captcha manually\r\n    And User clicks on Continue button\r\n    And User enters OTP \"valid_otp\"\r\n    And User enters signup password \"valid_password\"\r\n    And User enters confirm password \"valid_password\"\r\n    And User clicks on Signup button\r\n
